import React, { useState } from 'react';
import { action } from '@storybook/addon-actions';
import { BrowserRouter } from 'react-router-dom'
import Checkbox from '@material-ui/core/Checkbox';
import CustomCheckBox from '../components/Icons/customCheckbox';
import CheckboxChecked from '../components/Icons/checkboxChecked';
import IntermediateCheckbox from '../components/Icons/intermediateCheckbox'
import { styles, listItemTextStyles, CheckBoxWrapper } from '../components/CheckboxGroup/styles';
import PropTypes from 'prop-types';





export default {
  title: 'Checkbox',
  component: Checkbox,
};

export function CheckBoxContainer({
  label,
  show,
  id,
  checboxChange,
  shouldDisable,
  resultCount,
  intermediate,
  multi = false,
  state
}) {

  state = {
    isChecked: false && action("I've been clicked"),
    isDisabled: true
  }

  const classes = styles();
  const disable = shouldDisable

  return (
    <BrowserRouter>
      <h3>Checkboxes</h3>
        <h4>Standard</h4>
          <Checkbox checked={show} onClick={action("I've been clicked")}/>
        <h4>Custom</h4>
          <Checkbox icon={<CustomCheckBox />} onClick={action("I've been clicked")}/>
        <h4>Intermediate</h4>
          <Checkbox indeterminateIcon={<IntermediateCheckbox />} onClick={action("I've been clicked")} />
        <h4>Intermediate</h4>   
          <Checkbox disabled={this.isDisabled} onClick={action("I've been clicked")}/>
    </BrowserRouter>
  );
}

